import { Link } from "react-router-dom";
import style from "./Error.module.css";

const Error= ()=>{

    return(
        <div >
         <h1 className={style.text}>PAGE NOT FOUND</h1>   
         
         <img className={style.imagen} src="https://w.forfun.com/fetch/82/82acbb65382a27079dabc4a650e84f4a.jpeg?w=1470&r=0.5625" alt="" />
        
        </div>
    )
}

export default Error;
